      SELECT * FROM tab2 (FORMAT parquet) WHERE - col2 * - + ( - col2 ) NOT BETWEEN - - col1 + col1 + + - 92 - col0 * + - 25 AND - ( + col0 );
  - name: tab2

outputs:
